import React from 'react'

function Namelist() {
    const names=["Shubham","Pratim","Disha"];
    return (
        <div>
            <h1>{names[0]}</h1>
            <h1>{names[1]}</h1>
            <h1>{names[2]}</h1>
        </div>
    )
}
export default Namelist;
